INSERT INTO `toolbox_contact` VALUES (1,'Theo','Kleinendorst','theo.kleinendorst@acaciawater.com','','Hallo'),(2,'aa','aa','theo.kleinendorst@acaciawater.com','','aa'),(3,'Theo','Kleinendorst','tkleinen@gmail.com','','Dit is van de Hostway Server'),(4,'host','way','tkleinen@gmail.com','','Dit is van de hostway server'),(5,'host','way','tkleinen@gmail.com','','hostway'),(6,'hostway','server','tkleinen@gmail.com','','hostway server'),(7,'theo','Kleinendorst','theo.kleinendorst@acaciawater.com','','Van de hostway server'),(8,'Jacob','Oosterwijk','jacob.oosterwijk@acaciawater.com','2333','hoi'),(9,'Jacob','Oo','jacob.oosterwijk@acaciawater.com','333','test'),(10,'Sietze','Koster','s.koster@zuiderzeeland.nl','0611324010','Hoe kan ik toegang krijgen tot de volledige functionaliteit?\r\n\r\nIk zie met belangstelling je antwoord tegemoet.\r\n\r\nmet vriendelijke groet,\r\n\r\nSietze Koster'),(11,'M.L.','Moura','m.moura@utrecht.nl','030-2867357','We willen graag oefenen met de Grondwater Toolbox. Hoe krijgen we toegang tot de toolbox?\r\n\r\nMet vriendelijke groet,\r\n\r\nMario Moura'),(12,'Angelo','de Bruijn','Angelo.deBruijn@scheldestromen.nl','088-2461060','Misschien ben ik te voorbarig en moet wachten op 14 november aanstaande, maar ik wil graag toegang tot de volledige functionaliteit van de grondwatertoolbox.'),(13,'Frans','Glorie','fglorie16@gmail.com','31627827069','Ik zou graag een inlog verkrijgen '),(14,'Bart','van Paassen','b.van.paassen@baminfraconsult.nl','0615879595','Geachte heer / mevrouw,\r\n\r\nWij (BAM Infraconsult) zouden graag gebruik willen maken van deze toepassingen en zijn ook benieuwd naar de GIS-koppeling.\r\n\r\nIk verneem graag of en hoe dit mogelijk is.\r\n\r\nMet vriendelijke groet\r\nBart van Paassen\r\nAfd. Geotechniek, BAM Infraconsult'),(15,'Franco','van der Veeken','franco@hydrobouwadvies.nl','020-2629919','graag zou ik een inlognaam en wachtwoord willen ontvangen van uw website.\r\nm vr gr.\r\nFCM van der Veeken'),(16,'Wim ','op \'t Hoog','info@tbinfra.nl','013 153 0491','Graag zou ik de volledige toegang verkrijgen tot de grondwatertoolbox, bij voorbaat dank.\r\n\r\nmet vriendelijke groeten,\r\nWim op\'t Hoog'),(17,'Han','Grobbe','h.grobbe@concepts.nl','31628844200','Wat zijn de kosten voor een abonnement?'),(18,'Cindy','Harte','cindy.harte@wur.nl','','T.b.v. mijn studie: Hydrologisch modelleren maak ik graag gebruik van de Grondwatertoolbox en de daarvoor bestemde inlogcode. \r\n\r\nVriendelijke groeten, C. Harte'),(19,'Gerard','Abbink','gabbink@wve.nl','06-21169149','Hallo JAcob,\r\n\r\nVandaag een eerste poging gedaan met werken met de toolbox; doel om snel een bodemprofiel van de locatie te vinden uit TNO-Dino-loket. \r\nHet is mij echter niet gelukt om via de toolbox (archieffunctie) een situatie te krijgen waarbij het bodemprofiel uit dino geladen werd. \r\nWat is hiervoor de werkwijze cq hoe kan ik een bodemprofiel via de toolbox zichtbaar krijgen?\r\n\r\nIn afwachting van een reactie.\r\n\r\nMet vriendelijke groet,\r\nGerar Abbink'),(20,'Saskia','van \'t Veen','s.vantveen@jend.nl','06-17104660','Hallo,\r\n\r\nIk zou graag willen weten wat de volledige functionaliteit van de grondwatertoolbox inhoud en of er kosten aan verbonden zijn, voor de volledige toegang.\r\n\r\nZie graag het antwoord tegemoet.\r\n\r\nMet vriendelijke groet,\r\n\r\nSaskia van \'t Veen'),(21,'Joop','Meinders','j.meinders@hydrosoil.nl','31649653411','Graag  toegang tot de volledige functionaliteit van de toolwaterbox.\r\n\r\nmet vriendelijke groet\r\n\r\nJoop Meinders'),(22,'test','test','jacob.oosterwijk@acaciawater.com','test','test'),(23,'Hendrik','Meuwese','h.meuwese@witteveenbos.nl','010 244 2845','Hallo,\r\n\r\nDe grondwatertoolbox is opgenomen in de 1e druk van het Grondwaterzakboekje. Momenteel herzie ik samen met Bram Bot en anderen het Grondwaterzakboekje.\r\n\r\nVoor het herzien van de tekst bekijk ik graag de huidige toolbox. Kan ik hiervoor een login ontvangen? Bij vragen neem ik contact met jullie op.\r\n\r\nGroet,\r\n\r\nHendrik Meuwese'),(24,'Kevin','Wijtenburg','kevin.wijtenburg@waternet.nl','0652534499','Ik heb een aantal vragen over het verschil in definities van reikwijdte en spreidingslengte. Wanneer gebruik je welke formule en wat is het verschil. \r\nDaarnaast staat bij de reikwijdte-formule welke tijdonafhankelijk is de k-waarde in m/d terwijl dat volgens Sichardt in m/s moet zijn. \r\nKunnen jullie mij opbellen zodat mijn vragen worden beantwoord?\r\nBedankt!\r\n\r\nMvgr, Kevin Wijtenburg'),(25,'Johan','Wens','johan.wens@vanlaere.be','0032478571012','Graag had ik toegang verkregen tot volledige functionaliteit van de grondwatertoolbox'),(26,'Jeroen','van Uden','jeroen.vanuden@xmsnet.nl','0651755347','graag zou ik toegang willen krijgen tot de grondwatertoolbox.\r\n\r\nmet vriendelijke groet,\r\n\r\nJeroen van Uden'),(27,'Lars','Lamers','lars@bouten.nl','0681164181','Beste,\r\n\r\nIs de functionaliteit \'geotechnisch\'  nog niet beschikbaar, of dien ik extra handelingen te verrichten?\r\n\r\nM.v.g.\r\nLars Lamers'),(28,'Doeke','Dam','D.Dam@hhnk.nl','06-12519782','Graag zou ik tijdelijk toegang krijgen tot de volledige functionaliteit van de toolbox om deze uit te kunnen testen en te presenteren om vervolgens een afweging te kunnen maken over aanschaf.\r\n\r\nMet vriendelijke groet,\r\nDoeke Dam\r\nHHNK'),(29,'Marco','van Baar','marco.van.baar@gmail.com','06 26080766','Geachte mevrouw/meneer,\r\n\r\nIs de weergegeven formule op de internetpagina:\r\nhttp://www.grondwatertoolbox.nl/wizard/9\r\nwel juist?\r\n\r\nDeze komt namelijk niet overeen met de formule in de verantwoording van de gebruikte bron die eveneens op de pagina is geplaatst.\r\n\r\nhttp://www.grondwatertoolbox.nl/media/references/5.1.1.SleufbemalingSBRp102.pdf\r\n\r\nBij de formule zoals weergegeven in de referentie levert toename van kH en t een toename van het debiet zoals mag worden verwacht.\r\n\r\nDe formule op uw internetpagina (naast de berekening weergegeven) levert juist een afname van het debiet bij toename van de tijd. Dit lijkt mij niet juist, maar misschien zie ik iets over het hoofd.\r\n\r\nTevens wordt op uw website gesproken over elastische berging, terwijl volgens mij sprake is van freatische berging, juist zoals weergegeven in de verantwoording.\r\n\r\nDe berekening lijkt wel in orde, maar zo ontstaat bij mij toch ook twijfel daarover. Graag ontvang ik van uw zijde een bevestiging van de juistheid van de achterliggende berekening.\r\n\r\nMet vriendelijke groeten,\r\n\r\nMarco van Baar'),(30,'Jordy','Monninkhof','j.monninkhof@koopbronbemaling.nl','0653466551','Goedemorgen heer/mevrouw,\r\n\r\nEnige tijd geleden heb ik met de grondwatertoolbox gewerkt. Dat is mij zeker bevallen. Nu staat er echter bij jullie op de site dat het niet meer mogelijk is gratis te registreren. \r\nKunt u nagaan of ik geregistreerd ben? Zo niet wat zijn dan de kosten voor het registreren?\r\n\r\nIk wacht uw reactie graag af.\r\nMet vriendelijke groet,\r\nJ.Monninkhof\r\nKoop Bronbemaling'),(31,'Morty','Goldman','support@superbsocial.net','877-410-4002','Hello, my name is Morty Goldman; I just stumbled upon your site - www.grondwatertoolbox.nl - I\'m sorry to write in such an odd manner, I thought to call you but I didn\'t want to take up your time. What I have to say may be of great interest to you. Did you know that an overwhelming majority of businesses, organizations and celebrities buy likes and followers? What, you thought your competitor\'s likes and followers are organic and naturally gained? Ha ha. Just recently Gangman Style ( http://www.youtube.com/watch?v=9bZkp7q19f0 ) reached a record 2 billion views. Now imagine the scale of Gangnam Style\'s popularity being applied to your business! This is exactly how I deliver results to my clients - and I assure you that you\'ll be overwhelmingly pleased with the outcome. \r\n \r\nGive us a call: +1 (877) 410-4002 \r\nor visit us at http://www.SuperbSocial.net'),(32,'J.D.','Muys','jmuys@prosperus.nl','06-12436863','Geachte heer/ mevrouw,\r\n\r\nIk zou graag meer achtergrondinformatie willen ontvangen over een eventueel abonnement voor de grondwater toolbox.\r\n\r\nMet belangstelling zie ik uw reactie tegemoet.'),(33,'ar','','arjen.devries@acaciawater.com','','ddd'),(34,'Lavonne Star\r\n','Cherly Koellner\r\nAY','a.lb.e.rt.jo.n.a.th.en.1.980@gmail.com','123456','Do you have any Facebook page,Twitter account or YouTube video? Do you want to get more likes,followers or views. we can promote and increase Facebook likes,twitter followers and YouTube views affoardably and fast. \r\n \r\nPackages: \r\n \r\n1) 5,000 Facebook Fans/Likes ($67) = Order at:- http://socialeum.com/go/facebook/ \r\n2) 5,000 Twitter followers ($67)   = Order at:- http://socialeum.com/go/twitter/ \r\n3) 50,000 YouTube views ($50)      = Order at:- http://socialeum.com/go/youtube/ \r\n \r\n \r\nYou can also order smaller or bigger package from our official website. For any query, please visit :- http://socialeum.com/helpdesk \r\n \r\nDon\'t reply to this mail.We don\'t monitor inbox. \r\n \r\nThank You'),(35,'Richard','van der Does','r.vanderdoes@bgwt.nl','','Beste heer, mevrouw,\r\n\r\nGraag wil ik informatie aanvragen over het verkrijgen van een account om de volledige funcionaliteit van de grondwatertoolbox te gebruiken. Alvast bedankt.\r\n\r\nMet vriendelijke groet,\r\n\r\nRichard van der Does'),(36,'Camille','Vermeulen','cvermeulen@tjaden.nl','+31622429267','Beste,\r\n\r\nHoe zou ik toegang kunnen krijgen tot alle funcitonaliteiten van uw website?\r\n\r\nmvg\r\nCamille Vermeulen'),(37,'Devin','Devin','understoodyacht3c@rediffmail.com','123456','Hello, \r\n \r\nMy name is Devin Sorbert - I\'m a media manager at Social Media Gurus. We\'re a 3 person full social media management company based out of Greater Grand Rapids, Michigan. We handle account creation and growth for small businesses - and our 3rd partner has spent 3 years setting up Facebook and Google Adwords campaigns for small businesses for local lead generation for a Grand Rapids media management company before coming to work with us. \r\n \r\nI saw www.grondwatertoolbox.nl and want to know if you\'re interested in expanding your social media presence? Basically - more fans, likes and general engagement on your Facebook page? \r\n \r\nIt\'s really easy - we\'d do a free 15 minute consultation over phone or Skype - where we\'ll fill out a simple questionnaire to figure out the specific social media needs for your business. I\'ll show you some references and current clients pages that have consented to being used as examples (pet shelters and such) - and explain why more fans and activity on your page will help your business. If during the consultation we learn that you sell commercially/are happy with 10 fans on your page/have no business use for social media presence - I won\'t sell you garbage. Chemical factories don\'t need Facebook pages (unless they\'d like a corporate page) - and I won\'t argue with that. \r\n \r\nOur prices start at $189 a month for complete management and assistance of your media profile. Our prices reflect the service quality - if you\'ve had bad experiences buying fans for $20 on Fiverr that were deleted/had your account suspended - we can rectify that. We run small media campaigns throughout the month creating natural fan growth to your page - no automated accounts or likes, and no chance of any account issues. We also do not need any security information to promote your page - anyone who does probably uses a form of automation to grow your account. \r\n \r\nCheck out these monthly plans to get a full idea of everything we do for your page and then send me a reply for your consultation :) \r\nhttp://socialmediagurus.net/ \r\n \r\nIf I can help you - reply back at emailsocialmediagurus@mail.com and we\'ll set up a good time for you to create a plan for www.grondwatertoolbox.nl. \r\n \r\nHope I can assist you, \r\nDevin'),(38,'An','An','Rettig@hotmail.com','(219) 477-0619','Do you h