INSERT INTO `toolbox_problem` VALUES (1,'1.1.1.1','Berekening van het stationaire onttrekkingsdebiet voor een bemaling in een freatische aquifer','figures/Sit.1.1.Stationair3_copy_1.gif','formulas/1.1.1.1_1.jpg','# 1.1.1.1.a freatisch, stationair, onttrekking\r\nimport math\r\nR=1.5*math.sqrt(k*H*t/e) # reikwijdte\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nhr=H-dh # stijghoogte op afstand r\r\nQ=math.pi*k*(H*H-hr*hr) / (math.log(R) - math.log(r))',5),(3,'5.1.1','','figures/Peilverandering_detail_copy.gif','formulas/5.1.1.Sleufbemaling.jpg','# 5.1.1. Peilverandering - debiet - verlaging peil\r\nimport math\r\nfrom scipy.special import erfc\r\n#ts=[0.5,1,2,5,10,15,20,25,30]\r\n#xs=[10,15,20,25,30,35,50]\r\n\r\nqtab={}\r\nhtab={}\r\np = math.sqrt(math.pi)\r\nkD = k * H\r\n#for t in ts:\r\nq1 = dh / p * math.sqrt(kD * S / t) # q eenzijdig in m3/d/m\r\nq2 = 2 * l * q1 / 24.0 # q tweezijdig m3/h\r\nq3 = 2 * l * q1 * t\r\nQ = 2 * l * q1 # q tweezijdig m3/d\r\nqtab[t] = [q1,q2,q3]\r\nhs=[]\r\n#for x in xs:\r\nhr = dh * erfc(r / (2 * math.sqrt(kD * t / S)))\r\nhs.append(hr)\r\nhtab[t] = hs\r\n',9),(4,'2.1.1.1','','figures/Hooghoudt_copy_2.gif','formulas/2.1.Hooghoudt.jpg','# 2.1.1.1. Hooghoudt, opbolling, drains\r\nimport math\r\nu=math.pi*rd\r\nd=((math.pi*L)/8)/(math.log(L/u)+((math.pi*math.pi)/(4*((2*math.pi*D)/L)))+math.log(((2*math.pi*D)/L)/(2*math.pi)))\r\na=4*k1\r\nb=8*k2*d\r\nc=-1*(L*L*q)\r\nh=(-b+(math.pow((b*b)-4*a*c,0.5)))/(2*a)',13),(5,'1.1.1.2.a','','figures/Sit.1.1.Stationair2_copy.gif','formulas/1.1.1.dupuit.jpg','# 1.1.1.2.a freatisch, stationair, verlaging\r\nimport math\r\nR=1.5*math.sqrt(k*H*t/e) # reikwijdte\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nhr=math.sqrt((H*H)-(((math.log(R)-math.log(r))*Q)/(math.pi*k)))  # stijghoogte op afstand r\r\ndh=H-hr',6),(7,'1.1.2.1.a','','figures/Sit.1.1.Stationair_openwat_copy.gif','formulas/1.1.2.forchheimer_openwtr.jpg','# 1.1.2.1.a\r\nimport math\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nhr=H-dh #stijghoogte op afstand r\r\nQ=(math.pi*k*((H*H)-(hr*hr)))/(math.log(2*E)-math.log(r))',22),(9,'1.1.2.2.a','','figures/Sit.1.1.Stationair_openwater2.gif','formulas/1.1.2.forchheimer_openwtr_2.jpg','# 1.1.2.2.a\r\nimport math\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nhr=math.sqrt(H*H-(Q/(math.pi*k))*(math.log(2*E)-math.log(r))) #stijghoogte op afstand r\r\ndh=H-hr',21),(11,'1.1.3.1.a','','figures/Sit.1.1.Stationair_onvolko_copy.gif','formulas/1.1.3.forchheimer_onvlkbron.jpg','# 1.1.3.1.a\r\n### LET OP: ingeven met meer dan 1 decimaal!! anders T/H = 0\r\nimport math\r\nR=1.5*math.sqrt(k*H*float(t)/float(e)) # reikwijdte\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nhr=H-dh  # stijghoogte op afstand r\r\na=(math.sqrt(float(T)/float(H)))*(math.pow((2.0*H-T)/float(H),0.25))#onvolkomenheidsfactor\r\nQvolkomen=(math.pi*k*((H*H)-(hr*hr)))/(math.log(R)-math.log(r))#debiet volkomen bron\r\nQ=Qvolkomen*a',20),(13,'1.1.3.2.a','','figures/Sit.1.1.Stationair_onvolkomenbron2.gif','formulas/1.1.3.forchheimer_onvlkbron_2.jpg','# 1.1.3.2.a\r\nimport math\r\nR=1.5*math.sqrt(k*H*t/e) # reikwijdte\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\na=(math.sqrt(float(T)/float(H)))*(math.pow((2.0*H-T)/float(H),0.25))#onvolkomenheidsfactor\r\nQvolkomen=Q/a#debiet volkomen bron\r\nhr=math.sqrt((H*H)-(((math.log(R)-math.log(r))*Qvolkomen)/(math.pi*k)))  # stijghoogte op afstand r\r\ndh=H-hr\r\n',19),(15,'1.1.4.1.a','','figures/Sit.1.1.Stationair6_copy.gif','formulas/1.1.4.theisjacobedelman.jpg','#1.1.4.1.a\r\nimport math\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nhr=H-dh  # stijghoogte op afstand r\r\nWU=math.log(0.561/((e*r*r)/(4*k*H*t))) #putfunctie\r\nQ=(4*math.pi*k*H*dh)/WU',15),(17,'1.1.4.2.a','','figures/Sit.1.1.Stationair5_copy.gif','formulas/1.1.4.theisjacobedelman_2.jpg','#1.1.4.2.a\r\nimport math\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nWU=math.log(0.561/((e*r*r)/(4*k*H*t))) #putfunctie\r\ndh=Q/(4*math.pi*k*H)*WU\r\nhr=H-dh  # stijghoogte op afstand r',16),(19,'1.2.1.1.a','','figures/Sit.1.2.Stationair3_copy.gif','formulas/1.2.1.deglee.jpg','#1.2.1.1.a freatisch boven semi-spanning, stationair, onttrekking\r\nimport math\r\nfrom scipy.special import k0\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nlb=math.sqrt(k*H*c) # spreidingslengte\r\nbesselk0=k0(r/lb)\r\nQ=(dh*2*math.pi*k*H)/besselk0',35),(21,'1.2.1.2.a','','figures/Sit.1.2.Stationair2_copy.gif','formulas/1.2.1.DeGlee.jpg','#1.2.1.2.a freatisch boven semi-spanning, stationair, verlaging\r\nimport math\r\nfrom scipy.special import k0\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nlb=math.sqrt(k*H*c) # spreidingslengte\r\nbesselk0=k0(r/lb)\r\ndh=(Q/(2*math.pi*k*H))*besselk0',34),(23,'1.2.2.1.a','','figures/Sit.1.2.Stationair6_copy.gif','formulas/1.2.2.HantushJacob.jpg','#1.2.2.1.a freatisch boven semi-spanning, niet-stationair, onttrekking\r\nimport math\r\nfrom scipy.special import k0\r\nfrom scipy.special import expn\r\nfrom scipy.misc import factorial\r\n\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nlb=math.sqrt(k*H*c) # spreidingslengte\r\ntau=(r*r*e)/(4*k*H*t)\r\nrho=r/lb\r\nu=(rho*rho)/(4*tau)\r\ns=0\r\n\r\nfor n in range(0,15):\r\n	s = s + (((math.pow(-1,n)) / factorial(n)) * math.pow(tau,n) * expn(n + 1,u))\r\n\r\nWF = 2 * k0(rho) - s\r\n\r\nQ=(4*math.pi*k*H*dh)/WF\r\n',32),(25,'1.2.2.2.a','','figures/Sit.1.2.Stationair5_copy.gif','formulas/1.2.2.HantushJacob_1.jpg','#1.2.2.2.a freatisch boven semi-spanning, niet-stationair, verlaging\r\nimport math\r\nfrom scipy.special import k0\r\nfrom scipy.special import expn\r\nfrom scipy.misc import factorial\r\n\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nlb=math.sqrt(k*H*c) # spreidingslengte\r\ntau=(r*r*e)/(4*k*H*t)\r\nrho=r/lb\r\nu=(rho*rho)/(4*tau)\r\ns=0\r\n\r\nfor n in range(0,15):\r\n	s = s + (((math.pow(-1,n)) / factorial(n)) * math.pow(tau,n) * expn(n + 1,u))\r\n\r\nWF = 2 * k0(rho) - s\r\n\r\ndh=Q/(4*math.pi*k*H)*WF',33),(27,'1.3.1.1.a','','figures/Sit.1.3.Stationair3_copy.gif','formulas/1.3.1.DeGlee.jpg','#1.3.1.1.a semi-spanning, stationair, onttrekking (gelijk aan freatisch boven semi spanning)\r\nimport math\r\nfrom scipy.special import k0\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nlb=math.sqrt(k*D*c) # spreidingslengte\r\nbesselk0=k0(r/lb)\r\nQ=(dh*2*math.pi*k*D)/besselk0',30),(29,'1.3.1.2.a','','figures/Sit.1.3.Stationair2_copy.gif','formulas/1.3.1.DeGlee_1.jpg','#1.3.1.2.a semi-spanning, stationair, verlaging\r\nimport math\r\nfrom scipy.special import k0\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nlb=math.sqrt(k*D*c) # spreidingslengte\r\nbesselk0=k0(r/lb)\r\ndh=(Q/(2*math.pi*k*D))*besselk0',31),(31,'1.3.2.1.a','','figures/Sit.1.3.Stationair6_copy.gif','formulas/1.3.2.HantushJacob.jpg','#1.3.2.1.a semi-spanning, niet-stationair, onttrekking\r\nimport math\r\nfrom scipy.special import k0\r\nfrom scipy.special import expn\r\nfrom scipy.misc import factorial\r\n\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nlb=math.sqrt(k*D*c) # spreidingslengte\r\ntau=(r*r*S)/(4*k*D*t)\r\nrho=r/lb\r\nu=(rho*rho)/(4*tau)\r\ns=0\r\n\r\nfor n in range(0,15):\r\n	s = s + (((math.pow(-1,n)) / factorial(n)) * math.pow(tau,n) * expn(n + 1,u))\r\n\r\nWF = 2 * k0(rho) - s\r\n\r\nQ=(4*math.pi*k*D*dh)/WF',29),(33,'1.3.2.2.a','','figures/Sit.1.3.Stationair5_copy.gif','formulas/1.3.2.HantushJacob_1.jpg','#1.3.2.2.a semi-spanning, niet-stationair, verlaging\r\nimport math\r\nfrom scipy.special import k0\r\nfrom scipy.special import expn\r\nfrom scipy.misc import factorial\r\n\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nlb=math.sqrt(k*D*c) # spreidingslengte\r\ntau=(r*r*S)/(4*k*D*t)\r\nrho=r/lb\r\nu=(rho*rho)/(4*tau)\r\ns=0\r\n\r\nfor n in range(0,15):\r\n	s = s + (((math.pow(-1,n)) / factorial(n)) * math.pow(tau,n) * expn(n + 1,u))\r\n\r\nWF = 2 * k0(rho) - s\r\n\r\ndh=Q/(4*math.pi*k*D)*WF',28),(35,'1.4.1.1.a','','figures/Sit.1.4.Stationair-deklaag_copy.gif','formulas/1.4.1.Thiem.jpg','# 1.4.1.1.a\r\nimport math\r\nR=1.12*math.sqrt(k*D*c) # reikwijdte\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nhr=D-dh # stijghoogte op afstand r\r\nQ=(2*math.pi*k*D*dh)/(math.log(R)-math.log(r))',52),(37,'1.4.1.2.a','','figures/Sit.1.4.Stationair-deklaag5.gif','formulas/1.4.1.Thiem_1.jpg','# 1.4.1.2.a \r\nimport math\r\nR=1.12*math.sqrt(k*D*c) # reikwijdte\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\ndh=Q/(2*math.pi*k*D)*(math.log(R)-math.log(r))',53),(39,'1.4.2.1.a','','figures/Sit.1.4.Stationair-wvp3_copy.gif','formulas/1.4.2.Tessendorf.jpg','# 1.4.2.1.a\r\nimport math\r\nR=1.12*math.sqrt(k*D*c) # reikwijdte\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nhr=H-dh\r\nQ=((math.pi*k*((H*H)-(hr*hr)))/(math.log(R)-math.log(r)))-((math.pi*k*((H-D)*(H-D)))/(math.log(R)-math.log(r)))\r\n',54),(41,'1.4.2.2.a','','figures/Sit.1.4.Stationair-wvp2_copy.gif','formulas/1.4.2.Tessendorf_1.jpg','# 1.4.2.2.a\r\nimport math\r\nR=1.12*math.sqrt(k*D*c) # reikwijdte\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nhr=math.sqrt((H*H)-(((math.log(R)-math.log(r))*((math.pi*k*((H-D)*(H-D)))/(math.log(R)-math.log(r))+Q))/(math.pi*k)))\r\ndh=H-hr',55),(43,'1.4.3.1.a','','figures/Sit.1.4.Stationair-deklaag3.gif','formulas/1.4.3.TheisJacobEdelman.jpg','# 1.4.3.1.a\r\nimport math\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nhr=D-dh # stijghoogte op afstand r\r\nWU=math.log(0.561/((S*r*r)/(4*k*D*t))) #put functie\r\nQ=(dh*4*math.pi*k*D)/WU',56),(45,'1.4.3.2.a','','figures/Sit.1.4.Stationair-deklaag2.gif','formulas/1.4.3.TheisJacobEdelman_1.jpg','# 1.4.3.2.a\r\nimport math\r\nif r is None:\r\n    r=(L+B)/math.pi # equivalente straal\r\nWU=math.log(0.561/((S*r*r)/(4*k*D*t))) #put functie\r\ndh=Q/(4*math.pi*k*D)*WU',57),(47,'2.1.1.2.','','figures/Hooghoudt_copy.gif','formulas/2.1.Hooghoudt_1.jpg','# 2.1.1.2. Hooghoudt, opbolling, drains in grindkoffer\r\nimport math\r\nu=b+2*m\r\nd=((math.pi*L)/8)/(math.log(L/u)+((math.pi*math.pi)/(4*((2*math.pi*D)/L)))+math.log(((2*math.pi*D)/L)/(2*math.pi)))\r\na=4*k1\r\nb=8*k2*d\r\nc=-1*(L*L*q)\r\nh=(-b+(math.pow((b*b)-4*a*c,0.5)))/(2*a)',40),(48,'2.1.1.3.','','figures/Hooghoudt_copy_1.gif','formulas/2.1.Hooghoudt_2.jpg','# 2.1.1.2. Hooghoudt, opbolling, sloten \r\n###### LET OP: slootbreedte is breedte slootbodem, niet tpv wateroppervlak!!!\r\nimport math\r\nu=s+2*(math.sqrt((w*w)+(w*w)))\r\nd=((math.pi*L)/8)/(math.log(L/u)+((math.pi*math.pi)/(4*((2*math.pi*D)/L)))+math.log(((2*math.pi*D)/L)/(2*math.pi)))\r\na=4*k1\r\nb=8*k2*d\r\nc=-1*(L*L*q)\r\nh=(-b+(math.pow((b*b)-4*a*c,0.5)))/(2*a)',41),(49,'2.1.2.1.','','','formulas/2.1.Hooghoudt_3.jpg','#2.1.2.1. Hooghoudt, afstand, drains\r\nimport math\r\nu=math.pi*rd\r\n\r\nL1=10\r\nd1=1\r\ndiffL=1\r\ni=1\r\n\r\nwhile (i < 50) & (diffL > 1e-6):\r\n        d=((math.pi*L1)/8)/(math.log(L1/u)+((math.pi*math.pi)/(4*((2*math.pi*D)/L1)))+math.log(((2*math.pi*D)/L1)/(2*math.pi)))\r\n        diffd=math.fabs(d1-d)\r\n        d1=d\r\n\r\n        L=math.sqrt((8*k2*h*d1+4*k1*h*h)/q)\r\n        diffL=math.fabs(L1-L)\r\n        L1=L\r\n        i=i+1\r\n',43),(50,'2.1.2.2.','','','formulas/2.1.Hooghoudt_4.jpg','#2.1.2.2. Hooghoudt, afstand, drains in grindkoffer\r\nimport math\r\nu=b+2*m\r\n\r\nL1=10\r\nd1=1\r\ndiffL=1\r\ni=1\r\n\r\nwhile (i < 50) & (diffL > 1e-6):\r\n        d=((math.pi*L1)/8)/(math.log(L1/u)+((math.pi*math.pi)/(4*((2*math.pi*D)/L1)))+math.log(((2*math.pi*D)/L1)/(2*math.pi)))\r\n        diffd=math.fabs(d1-d)\r\n        d1=d\r\n\r\n        L=math.sqrt((8*k2*h*d1+4*k1*h*h)/q)\r\n        diffL=math.fabs(L1-L)\r\n        L1=L\r\n        i=i+1',44),(51,'2.1.2.3.','','','formulas/2.1.Hooghoudt_5.jpg','#2.1.2.3. Hooghoudt, afstand, sloten\r\n#### LET OP: slootbreedte is breedte slootbodem, niet tpv wateroppervlak!!!\r\nimport math\r\nu=s+2*(math.sqrt((w*w)+(w*w)))\r\n\r\nL1=10\r\nd1=1\r\ndiffL=1\r\ni=1\r\n\r\nwhile (i < 50) & (diffL > 1e-6):\r\n        d=((math.pi*L1)/8)/(math.log(L1/u)+((math.pi*math.pi)/(4*((2*math.pi*D)/L1)))+math.log(((2*math.pi*D)/L1)/(2*math.pi)))\r\n        diffd=math.fabs(d1-d)\r\n        d1=d\r\n\r\n        L=math.sqrt((8*k2*h*d1+4*k1*h*h)/q)\r\n        diffL=math.fabs(L1-L)\r\n        L1=L\r\n        i=i+1\r\n',45),(52,'5.1.a','Reikwijdte langdurige bemalingen.\r\n\r\nIn de praktijk blijkt dat de reikwijdte toeneemt met toenemende tijdsduur. In de praktijk zullen de invloedssfeer, de reikwijdte en de spreidingslengte beperkt worden door verschillende vormen van voeding (neerslag, open water, nalevering uit aangrenzende lagen). Het is derhalve zeer gevaarlijk om aan een van de drie berekende kengetallen (invloedssfeer, reikwijdte, spreidingslengte) absolute waarde te hechten (SBR, 2003, pag. 27).','figures/Reikwijdte_langdurend_copy.gif','formulas/5.1.a.reikwijdte_langdurigebemaling.jpg','#5.1.a Reikwijdte, Langdurige bemalingen\r\nimport math\r\nR=1.5*math.sqrt(k*D*t/e)',64),(53,'5.1.b','Reikwijdte kortdurende bemalingen (4 - 7 dagen).\r\n\r\nIn de praktijk blijkt dat de reikwijdte toeneemt met toenemende tijdsduur. In de praktijk zullen de invloedssfeer, de reikwijdte en de spreidingslengte beperkt worden door verschillende vormen van voeding (neerslag, open water, nalevering uit aangrenzende lagen). Het is derhalve zeer gevaarlijk om aan een van de drie berekende kengetallen (invloedssfeer, reikwijdte, spreidingslengte) absolute waarde te hechten (SBR, 2003, pag. 27).','figures/Reikwijdte_kortdurend_copy.gif','formulas/5.1.b.reikwijdte_kortdurendebemaling.jpg','#5.1.b Reikwijdte, Kortdurende bemalingen\r\n## k ingeven met meerdere decimalen!\r\nimport math\r\nkms=k/(24*60*60)\r\nR=3000*dh*math.sqrt(kms)',65),(54,'5.1.c','Reikwijdte drains (empirisch).\r\n\r\nIn de praktijk blijkt dat de reikwijdte toeneemt met toenemende tijdsduur. In de praktijk zullen de invloedssfeer, de reikwijdte en de spreidingslengte beperkt worden door verschillende vormen van voeding (neerslag, open water, nalevering uit aangrenzende lagen). Het is derhalve zeer gevaarlijk om aan een van de drie berekende kengetallen (invloedssfeer, reikwijdte, spreidingslengte) absolute waarde te hechten (SBR, 2003, pag. 27).','figures/Reikwijdte_drainage_copy.gif','formulas/5.1.c.reikwijdte_drains.jpg','#5.1.c Reikwijdte, Drains, empirisch bepaald\r\n## k ingeven met meerdere decimalen!\r\nimport math\r\nkms=k/(24*60*60)\r\nR=1750*dh*math.sqrt(kms)',66),(55,'5.1.d','Reikwijdte semi-spanningswater.\r\n\r\nIn de praktijk blijkt dat de reikwijdte toeneemt met toenemende tijdsduur. In de praktijk zullen de invloedssfeer, de reikwijdte en de spreidingslengte beperkt worden door verschillende vormen van voeding (neerslag, open water, nalevering uit aangrenzende lagen). Het is derhalve zeer gevaarlijk om aan een van de drie berekende kengetallen (invloedssfeer, reikwijdte, spreidingslengte) absolute waarde te hechten (SBR, 2003, pag. 27).','figures/Reikwijdte_spanning_copy.gif','formulas/5.1.d.reikwijdte_semispanning.jpg','#5.1.d. Reikwijdte, Semispanningswater\r\nimport math\r\nR=1.12*math.sqrt(k*D*c)',67),(57,'5.1.e','Spreidingslengte: bij (semi-)spanningspakketten wordt de maat voor de afstand met merkbare invloed van de bemaling bepaald door de karakteristieke lengte, leklengte of spreidingslengte (SBR, 2003).\r\n\r\nIn de praktijk blijkt dat de reikwijdte toeneemt met toenemende tijdsduur. In de praktijk zullen de invloedssfeer, de reikwijdte en de spreidingslengte beperkt worden door verschillende vormen van voeding (neerslag, open water, nalevering uit aangrenzende lagen). Het is derhalve zeer gevaarlijk om aan een van de drie berekende kengetallen (invloedssfeer, reikwijdte, spreidingslengte) absolute waarde te hechten (SBR, 2003, pag. 27).','figures/Spreidingslengte_copy.gif','formulas/5.1.e.spreidingslengte.jpg','#5.1.e Spreidingslengte\r\nimport math\r\nlb=math.sqrt(k*D*c)',60),(58,'5.4','','figures/gemKwaarde_copy.gif','formulas/5.4.gemiddeldedoorlatendheid.jpg','import math\r\nif (lagen == 1):\r\n    D_tot=D1\r\n    c_tot=D1/kv1\r\n    kv_gem=kv1\r\n    kh_gem=kh1\r\n\r\nif (lagen == 2):\r\n    D_tot=D1+D2\r\n    c_tot=(D1/kv1)+(D2/kv2)\r\n    kv_gem=D_tot/c_tot\r\n    kh_gem=((kh1*D1)+(kh2*D2))/D_tot\r\n\r\nif (lagen == 3):\r\n    D_tot=D1+D2+D3\r\n    c_tot=(D1/kv1)+(D2/kv2)+(D3/kv3)\r\n    kv_gem=D_tot/c_tot\r\n    kh_gem=((kh1*D1)+(kh2*D2)+(kh3*D3))/D_tot\r\n\r\nif (lagen == 4):\r\n    D_tot=D1+D2+D3+D4\r\n    c_tot=(D1/kv1)+(D2/kv2)+(D3/kv3)+(D4/kv4)\r\n    kv_gem=D_tot/c_tot\r\n    kh_gem=((kh1*D1)+(kh2*D2)+(kh3*D3)+(kh4*D4))/D_tot',61),(59,'5.5','','figures/EqStraal_copy.gif','','import math\r\nr=(L+B)/math.pi',62);
